English | CBR | 7 Issues

Superior Spider-Man #13-19
Publisher:  Marvel
Publication Date:  July 10, 2013 - October 16, 2013

Superior Spider-Man #13
Superior Spider-Man teams up with the Lizard! Mayor Jameson demands that Spider-Man KILL the Spider-Slayer!

Superior Spider-Man #14
New friends, new foes, and an all new game-plan. The web-slinger as you've never seen him before.

Superior Spider-Man #15
What's it like to be a villain in the Marvel Universe... Once the Superior Spider-Man sets his sights on you? Find out, from Phil Urich's point of view, in what might be the final days of the Hobgoblin. Plus, what is the secret of &quot;The Tinkerer's Apprentice&quot;? Who's been helping the Terrible Tinkerer? And how is he, of all people, the reason everything in Spider-Man's life will be changed forever?

Superior Spider-Man #16
How has the Hobgoblin evaded the Superior Spider-Man for so long? And does that hold the key to the Superior Spider-Man's greatest success -- or greatest failure? It's the end of the line for Hobgoblin, and possibly an end for a big chapter in the history of Spider-Man

Superior Spider-Man #17
He's back...because you (loudly) demanded it! The return of Spidey 2099! And an Osborn you have not seen in a while...

Superior Spider-Man #18
Superior Spider-Man vs. Spider-Man 2099. Who will be the most superior Spider in the Multi-verse? Plus, secrets uncovered in time!

Superior Spider-Man #19
The moment that changes world of Spider-Man, and the Marvel Universe for years to come. Which Spider-Man is responsible for such a thing? Spider-Man 2099 or the Superior Spider-Man? Major developments for both Spider-Man's cast... and for the future.

Thanks goes to theProletariat for this release.

